import React from 'react';
import "../styles/header.css"

export const Footer = () => {
    return (
        <footer>
            <div>
                <p className='font'>THANKS FOR VISITING!</p>
                <nav>
                    <a href="https://instagram.com/mwyeoh">Instagram</a>
                    <a href="https://linkedin.com/myeoh">Linkedin</a>
                </nav>
            </div>
        </footer>
    )
}
